import React from 'react';
import Head from 'next/head';
import Layout from '../components/Layout';

const Home = () => {
    return(
        <>
            <Layout>
                <Head>
                    <title>Inicio</title>
                </Head>         
            </Layout>
            <h1>Home</h1> 
        <style jsx>{`
            #Layout{
                background: #2F3540;
                width: 100%;
                height: 100vh;
            }
        `}</style>
        </>
    )
}
export default Home;
